async fn get_animation(total_contributions: usize) -> String {
    // bg animation
    let mut bg_animation = String::new();
    for count in 1..=total_contributions {
        let temp = format!(
            "\n\n#content-{}-bg {{
        opacity: 0;
        animation: fade_in_background 0.5s ease {}s 1 forwards
      }}",
            count,
            parse_proper_time(count as f32 * DEFAULT_ANIMATION_DELAY)
        );
        bg_animation.push_str(&temp);
    }

    // text animation
    let mut text_animation = String::new();
    for count in 1..=total_contributions {
        let temp = format!(
            "\n\n#content-{} {{
        opacity: 0;
        animation: fade_in 0.5s ease {}s 1 forwards
      }}",
            count,
            parse_proper_time((count as f32 + 1.0) * DEFAULT_ANIMATION_DELAY)
        );
        text_animation.push_str(&temp);
    }

    format!(
        r##"
      @keyframes fade_in_background {{
          from {{
            opacity: 0;
          }}
          to {{
            opacity: 1;
          }}
      }}

      #title-bg {{
          opacity: 0;
          animation: fade_in_background 0.5s ease 0.00s 1 forwards
      }}

      {}

      @keyframes fade_in {{
          from {{
              opacity: 0;
              transform: translate(0, 3px);
          }}
          to {{
              opacity: 1;
          }}
      }}

      #title {{
        opacity: 0;
        animation: fade_in 0.5s ease 0.15s 1 forwards
      }}

      {}
"##,
        bg_animation, text_animation,
    )
}

fn parse_proper_time(seconds: f32) -> f32 {
    format!("{:.2}", seconds / 100.0).parse::<f32>().unwrap()
}
